// react
import React from 'react';

// third-party


export function NavigationLinks() {
    return (
        <ul className="nav-links__list">
            <li className="nav-links__item">
                <a>
                    <span>General search</span>
                </a>
            </li>
            <li className="nav-links__item">
                <a>
                    <span>Sent/Received docuents search</span>
                </a>
            </li>
            <li className="nav-links__item">
                <a>
                    <span>Settings</span>
                </a>
            </li>
        </ul>
    );
}
